C.UQ=new L.z("Tooltips are nice, but can get in the way when you know the app. Flexfold allows your app to turn off its tooltips. Why not give users this choice for all other tooltips in your app too?",null,null,null,null,null,null,null,null)
C.yT=new L.z("Always use a bottom side border on the app bar",null,null,null,null,null,null,null,null)
C.UR=new L.z("Show the bottom navigation bar also when the rail or menu is shown. CAUTION: Not recommended, it may be confusing. Useful mostly for testing purposes, but it can also be used as an accessibility feature",null,null,null,null,null,null,null,null)
C.US=new L.z("Sidebar title",null,null,null,null,null,null,null,null)
C.UT=new L.z("Bottom bar opacity",null,null,null,null,null,null,null,null)
C.yU=new L.z("This setting is only useful if the scaffold body content also scroll behind the app bar. With the API you can also change the opacity",null,null,null,null,null,null,null,null)
C.UV=new L.z("Use modal routes when appropriate",null,null,null,null,null,null,null,null)
C.UY=new L.z("Show menu footer widget",null,null,null,null,null,null,null,null)
C.UZ=new L.z("There is a Breakpoint class used to get suitable amount of columns for this demo. It can be used to create different grid layouts all the way up to 4k widths. This screen is a nice stress test on a large canvas. If you maximize this screen on a 4K screen and toggle the menu, the animation will cause all the SVG images on the screen to be rescaled and redrawn in every frame. It is a good stress test of Flutter and it actually works very well, much better than resizing windows in Flutter does. Window resizing and resulting redraws still need improvements in Flutter. This demo app could perhaps be better optimized too.\n\nThe Undraw images bundled with the app are used as demo content in the grid. The images are presented in random order with a box with a border of a random color with high saturation in the light theme mode. In dark theme a less saturated color of the same hue is used. If you toggle the theme using the side menu toggle, you can see the difference. A nice detail to notice is that each image is also using the same random border color as a color theme in each actual image.\n\nThere are only 30 different images. A random reference to each image and its random color are generated and stored in a list the when the page is created. While the list with asset reference and color info is static, the actual images are lazily built with a builder. This demo list stops at 500 items, it's a nice looking Flutter stress test, especially on the web.\n\nWith this page you can also test and see how Slivers work when the sidebar is a part of Scaffold body or outside it. It has bigger visual impact when and if a bottom navigation bar is used in a large canvas layout. Here we can use the test toggle to always show the bottom navbar to see it in a large layout. The setting that shows the bottom navbar when the menu is manually hidden and sidebar remains pinned visible, is probably a more real use case.\n",null,null,null,null,null,null,null,null)
C.V_=new L.z("FLAT BUTTON",null,null,null,null,null,null,null,null)
C.V1=new L.z("When the view switches to a rail or side menu, the tab view is an excellent choice and works really well for related views for the active destination. This page shows this when you use a larger canvas that switches to rail or menu view.\n\nIn this example the tab bar is not anchored to bottom part of the app bar, it is in the top part of the body. The side bar is also present on this screen so we can see how it works with a tab bar view as well. ",null,null,null,null,null,null,null,null)
C.V2=new L.z("Show the bottom navigation bar also when the rail or menu is shown.\nCAUTION: Not recommended, can be confusing. Use for testing purposes. May be useful as an accessibility feature",null,null,null,null,null,null,null,null)
C.V6=new L.z("The Material standard shows the sidebar as a part of the scaffold body. Turn off this setting to have it outside the Scaffold, like the side menu and rail is. In that case it has its own app bar when pinned to the side. This setting affects if a bottom bar, when used on a large canvas, covers the sidebar or not.",null,null,null,null,null,null,null,null)
C.V7=new L.z("\nThe sidebar can be used to hold less used content in an application. It could be a search filter, a list of picked or selected items, maybe even usage instructions and guides.\n\nWhen you define Flexfold destinations, you can define which destinations should have a sidebar, every destination does not have to have one. In this demo app only the Setup, Theme, Tabs and Slivers destinations have a sidebar, the other pages do not have one.\n",null,null,null,null,null,null,null,null)
C.V8=new L.z("Show tooltips",null,null,null,null,null,null,null,null)
C.Va=new L.z("In addition to the indexes, the destination's named route is included as a return value in the class. The navigator source and index change direction are also included. You can use this information to determine how you want to navigate to the destination.\n\nThis demo shows how this destination information can be used to to build different page transitions depending on where you navigated from. From locked side menu there is no transition. From a rail or a drawer the FadeTrough transition from the Flutter Animations packages is used. The bottom navigation uses the shared axis transition. The purpose of this transition design is to use transitions that fit the most likely devices used for the navigation method.\n",null,null,null,null,null,null,null,null)
C.Vb=new L.z("List tile sub title",null,null,null,null,null,null,null,null)
C.yV=new L.z("Use a gradient app bar to make it more dynamic. With the API you can change the strength and direction of the gradient. The gradient is automatically always based on your app bar color",null,null,null,null,null,null,null,null)
