C.Vn=new L.z("Break from bottom navigation bar to rail at",null,null,null,null,null,null,null,null)
C.Vo=new L.z("ON by default, but you can turn it off",null,null,null,null,null,null,null,null)
C.Vq=new L.z("Use iOS blur effect on none iOS bottom bars. Cupertino bottom navigation bar is always frosted glass blurred when transparent",null,null,null,null,null,null,null,null)
C.Vt=new L.z("With Flexfold it is easy to include a gradient transparent app bar, there is a styled app bar factory to help make app bars like the ones you see in this demo. When you combine the gradient transparent app bar with a white app bar theme, you get a Material themed app bar that resembles common iOS style app bars a bit. It is however not not using the frosted glass filter, but the effect is a bit similar.\n\nThis page uses a vertical scroll view that stops just before the tab bar, so you will not see the scroll behind app bar effect on this particular page. It is however visible on all other pages in this demo.\n\nThe Setup page already contains the app bar settings. This page just explains in a bit more depth how the app bar  made with the styled factory can be useful. There is a feature that show current canvas size in the app bar. You can use it to verify that your responsive layouts work as designed during development.\n",null,null,null,null,null,null,null,null)
C.Vu=new L.z("The breakpoints for when the navigation type changes can be adjusted, the defaults work well enough for most use cases.\n\nNavigation destination labels only appear as tooltips in rail mode in order to create a slim icon only rail, suitable for tablets and landscape mode on phones.\n\nA sidebar using an end drawer is also supported. It can also become a permanent fixture on a wide enough canvas. The sidebar entrance also animates when its breakpoint is exceeded. Its visibility as a permanent fixture can also be toggled. The widths of the rail, side menu and the tools menu can be individually adjusted. \n\nIn this demo you can play with the settings and observe Flexfold in action. The API for the Flexfold has more features in addition to those demonstrated here.\n\nYou will find the key settings on the Setup page, but there are more usage hints and setup gems on other pages in the this demo app as well.",null,null,null,null,null,null,null,null)
C.Vv=new L.z("Rail width",null,null,null,null,null,null,null,null)
C.Vx=new L.z("Switch list tile",null,null,null,null,null,null,null,null)
C.Vw=new L.z("This demo uses the newer Flutter Material 2018 typography instead of the older current Flutter default one from 2014. This creates a slightly different look.\n\nThe FlexColorScheme API allows you to set visualDensity, fontFamily, platform and typography directly without having to use the standard ThemeData factory. For more involved theme customization you can also create the starting point theme data object by using FlexColorScheme().theme and apply additional theming to it with Flutter's standard methods.\n",null,null,null,null,null,null,null,null)
C.VA=new L.z("Bottom destinations in drawer",null,null,null,null,null,null,null,null)
C.VG=new L.z("Theming is not a part of Flexfold, it is included as an extra feature in this demo application. The theming shown here is done with another package called FlexColorScheme. This page presents the kind of theming that is simplified by using it.\n\nFlexColorScheme uses Flutter's newer ColorScheme based themes. It is similar to the standard ThemeData.from in that a theme is created from a ColorScheme. It has two convenience factories, FlexColorScheme.light and FlexColorScheme.dark. FlexColorScheme also address some theme gaps in the standard Theme.from ColorScheme.\n\nFlexColorScheme supports using a white appbar theme in light mode and a primary colored one in dark mode. Dark mode also support an even darker mode called true black. Different levels of pre-defined branded surface colors, with primary color blended into surfaces to create color branded light and dark themes are also supported.\n\nIn addition to the default material design standard theme, which is also included in the Flutter's ColorScheme, FlexColorScheme comes comes with a few extra themes to get you started theming your app.\n",null,null,null,null,null,null,null,null)
C.VH=new L.z("Full responsive layout of the content body in this app is not part of the Flexfold demo and has not been paid too much attention to, but it has been verified to work well enough from normal phone sizes to large web and desktop canvas sizes. The content presentation is however not always optimally designed for phones.",null,null,null,null,null,null,null,null)
C.VI=new L.z("When you have destinations in a bottom navigation bar and additional destinations in a drawer, you may want the navigation to such additional destinations to be modal when you navigate to them and your canvas is phone sized that does not show all destinations in the rail or side menu.\n\nWith Flexfold you can use the source of the navigation to determine if you want push a full screen route on top of the Flexfold scaffold with only back option available or push a replacement named version of it only into the body part.\n\nFlexfold does not normally show bottom navigation bar destinations in the drawer during bottom bar navigation mode. However, if you navigate to a destination in bottom navigation mode that is not on the bottom navigation bar, then if you open the drawer again after this, you will find the bottom navigation bar destinations in the drawer.\n",null,null,null,null,null,null,null,null)
C.VM=new L.z("Show bottom navigation when menu is hidden",null,null,null,null,null,null,null,null)
C.VO=new L.z("Use a drawer and always keep bottom navigation bar hidden. A setting for people that thinks the bottom bar gets in the way",null,null,null,null,null,null,null,null)
C.VQ=new L.z("Not Selected Chip",null,null,null,null,null,null,null,null)
C.VS=new L.z("\nFlexfold destinations can also be configured to use FABs. FAB usage can be defined per destination.\n ",null,null,null,null,null,null,null,null)
C.VT=new L.z("Only useful if content extends behind the app bar",null,null,null,null,null,null,null,null)
C.VY=new L.z("Top side border",null,null,null,null,null,null,null,null)
C.yW=new L.z("To assist with responsive app development, you can show current canvas size in the styled app bar. This is usually not a setting you want to enable for end users, but useful during development",null,null,null,null,null,null,null,null)
C.VZ=new L.z("Show sidebar at",null,null,null,null,null,null,null,null)
C.W_=new L.z("Default value is 246 ms, that matches the hard coded Drawer animation time",null,null,null,null,null,null,null,null)
C.W0=new L.z("The Flexfold layout design is primarily intended for Flutter applications that target Desktop and Web, but it is also useful for resizable apps on tablets and Chrome books. Sure, it works great for switching between portrait and landscape mode on phones and tablets too, offering navigation flexibility on phones and tablets as well.\n\nThis feature demonstration application uses named routing. You do not have to use named routes, but it is recommended. Named routes are easy with Flexfold and they also provide URL based routes if you plan to release your Flutter app on the Web. 'The 'onChangeDestination' callback from the Flexfold package provides not just an index for the tapped destination, but a class with the values that you see in each page header in this demo.\n",null,null,null,null,null,null,null,null)
C.W1=new L.z("Blurred frosted glass effect",null,null,null,null,null,null,null,null)
C.W2=new L.z("Just because we can and for fun, let us show all the beautiful Undraw SVG images used in this demo app in a grid and then randomly animate in a new one.\n\nEach image box that randomly display one of the images has its own random wait duration before it switches and also a random switch animation time.\n\nEach time the screen is built, each image box gets a random colored border and a less saturated version of it is calculated for dark mode. When you switch to dark mode, it still has the same color hue based on the light theme's random color.\n\nAnother feature is that every image is color themed dynamically to match the color of its border. This is done by changing a color text string in the SVG file image data.\n",null,null,null,null,null,null,null,null)
C.W3=new L.z("Keep the rail and side menu in the drawer, even when their breakpoints are exceeded",null,null,null,null,null,null,null,null)
C.W4=new L.z("Selected list tile title",null,null,null,null,null,null,null,null)
C.W5=new L.z("The sidebar can of course contain any kind of widget. This example share the same content on all pages that have a side sidebar, but of course you can show whatever you like, just make sure that it fits nicely in the available width.\n\nJust for fun, here are some themed faster switching random Undraw images.",null,null,null,null,null,null,null,null)
C.W6=new L.z("Always hide the rail and side menu",null,null,null,null,null,null,null,null)
C.yX=new L.z("If the app bar is dark or white, a border will be drawn at its bottom side. With the API you can set this separately for the app bar on the menu and main body, as well as on the sidebar app bar",null,null,null,null,null,null,null,null)
C.Wb=new L.z("Use a border on the top side of the bottom navbar",null,null,null,null,null,null,null,null)
C.We=new L.z("Dark theme with primary colored app bar",null,null,null,null,null,null,null,null)
C.Wf=new L.z("Break from rail to side menu at",null,null,null,null,null,null,null,null)
C.yY=new L.z("When enabled and combined with a transparent app bar, you can see content scroll behind it",null,null,null,null,null,null,null,null)
C.Wg=new L.z("Not a very common design",null,null,null,null,null,null,null,null)
C.Wh=new L.z("\nThis demo app does not expose any settings for the FABs, but the pages Setup and Theme have been configured to have and show Floating action buttons.\n\nWith the API the FAB position can also be defined for each navigation mode separately, so that the FAB shows up as expected on the bottom right in phone bottom navigation mode and on the top in tablet and desktop mode or wherever you want it to be in each mode.\n\nOn the todo list is to add some pre-configured FAB locations that will also place the FAB on the edge of the rail or menu.",null,null,null,null,null,null,null,null)
C.Wi=new L.z("Show the bottom navigation when the rail/menu is manually hidden and we are not below the bottom navigation mode breakpoint.",null,null,null,null,null,null,null,null)
C.Wj=new L.z("Menu selection highlight height",null,null,null,null,null,null,null,null)
C.Wm=new L.z("This demo has an extra theme switch as a trailing widget",null,null,null,null,null,null,null,null)
C.Wo=new L.z("A toggle to lock and minimize the menu on a large canvas is built in to the menu button. It enables users to hide the side menu or rail in order to make more space available for the app content. You can hide the menu completely or make it a rail, also on desktop and web canvas sizes. Similar user control is also available for the optional sidebar, that can be in the end drawer or pinned to the screen on a large canvas.\n",null,null,null,null,null,null,null,null)
C.Wp=new L.z("OUTLINE BUTTON",null,null,null,null,null,null,null,null)
C.Wq=new L.z("You can adjust how Flexfold behaves by changing its setup.\n\nFlexfold offers a large number of responsive behaviors that you can adjust via its API or allow users to modify via settings, like in this demo.\n\nIn addition to the responsive settings there is a large number of style settings that are easy to adjust to create a personalized look.\n\nThe navigation mode changes are animated to create a smooth transition from bottom, to rail and side menu. The animation durations and curves can be adjusted.\n\nWidth of the rail, locked menu and sidebar can also be changed, within given limitations.\n",null,null,null,null,null,null,null,null)
C.Wr=new L.z("This feature is required so you do not get stranded without a way back to bottom bar destinations in this navigation mode. Another and a better way to tackle this is to push the destinations that are only in the drawer in this navigation mode as new full screen modal routes on top of the entire Flexfold scaffold with only back option available. This is normal and often preferred way of navigating from such extra drawer destinations.\n\nThis example application has been made to do so, by default using the prefer push info returned by the FlexfoldSelectedDestination information for such destinations, which are Home, Help and About in this demo app.\n\nEven when using this capability, it is still potentially possible to get stranded. If you in rail or menu mode navigate to Home, Help or About the destination should preferably not be pushed as a full screen with only back option, preferably we should only get the destination content replaced into the body part of the app. This demo app works this way. However, in this mode if you then resize the canvas to enable bottom navigation mode, the Home, Help and About views in this app do not know that they should change to full screen view with a back button taking user back to last used bottom navigation destination. In this scenario navigation to the bottom destinations will still be possible as they are now automatically present in the drawer. ",null,null,null,null,null,null,null,null)
C.Wu=new L.z("Keep using a rail even when the menu breakpoint is exceeded",null,null,null,null,null,null,null,null)
C.yZ=new L.z("Trailing",null,null,null,null,null,null,null,null)
C.Wy=new L.z("Menu animation duration",null,null,null,null,null,null,null,null)
C.Wz=new L.z("Side border on drawers in dark mode",null,null,null,null,null,null,null,null)
C.WA=new L.z("Company Ltd",null,null,null,null,null,null,null,null)
C.WC=new L.z("The switch list tile is ON",null,null,null,null,null,null,null,null)
C.WD=new L.z("Normal app bars can be a bit dull. This demo shows how you can make them more interesting by introducing a gradient into them, together with an optional transparency that also increases gradually.\n\nThe reason for the gradient is just to make the app bar more dynamic and interesting. Whereas the gradient transparency is used to display content behind the app bar as content scrolls below it.\n\nA transparent gradient that is fully opaque at the start of the app bar and increases in transparency towards the end, ensures that the title is always legible and keeps the effect subtle. A gradient and transparent app bar is still a matter of opinion and you can turn them off, as well as the scrolling behind the app bar or don't use the optional styled app bar constructor at all.\n",null,null,null,null,null,null,null,null)
C.WE=new L.z("Side borders on drawers in dark mode are ON by default. In true black mode they are really needed. With the API you can change their color. There is also an API to enable side borders for light mode. It is OFF by default as it is normally not needed",null,null,null,null,null,null,null,null)
